import React from "react";

const Posts = ({ posts }) => {
  return (
    <div>
      <ul>
        {posts.map((post) => (
          <li key={post.no}>
            <a href="http://localhost:8080/api/diary/62">
              {post.no} - {post.title}
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Posts;
